import axios from 'axios'
import React, { useState } from 'react'
import { useEffect } from 'react';

function Users (){



    let {data} = useState();

    useEffect(
        axios.get('https://jsonplaceholder.typicode.com/users')
            .then( response =>{


        this.setState({
            data : response.data
        })
    })

    )
    let mapping = ()=>{
        return( data.map( res =>
            <p>{res.id}- {res.name} <br />Email: {res.email}</p>
            )
        )
    }
    return(
            <div className='box'>
                {mapping}    
            </div>

    )
}


export default Users
